import React from 'react';
import Header from '../components/Header';
import Footer from '../components/Footer';

const Blog = () => {
    return (
        <BlogContainer>
            <Header />
            <BodyContainer>
            <h1>Blog</h1>
            </BodyContainer>
            <Footer />
        </BlogContainer>
    )
};

export default Blog;
